import React from "react";
// import "bootstrap/dist/css/bootstrap.min.css";

import "../../assets/css/compeounder.css"; // Adjust the path as needed
import "../../assets/css/innerstyle.css"; // Adjust the path if necessary

const SatffSolutionPage = () => {
  return (
    <div>
      <section className="solution-wrapper">
    <figure className="solution-image">
        <img src="images/doctor-patient.jpg" alt="" />
    </figure>
    <div className="container">
        <div className="row">
            <div className="col-md-6 offset-md-6">
                <div class="homeHeading">
                    <h2>Staffing Solution </h2>
                </div>
                <p> Discover the ultimate solution for your hospital or rehab center's caregiver needs with comePounder's innovative B2B service “Accel-care”. Designed specifically for expansion and new facility setups, our platform connects you with a vast network of skilled professionals— nurses, physiotherapists, and more—tailored to your exact requirements and rate expectations. Say goodbye to the hassle of individual recruitment and hello to streamlined, efficient caregiver acquisition. With comePounder, ensure your new locations are staffed with toptier talent, allowing you to focus on what matters most: exceptional patient care.
                </p>
            </div>
        </div>
    </div>
</section>
    </div>
  );
};

export default SatffSolutionPage;
